import React from 'react'
import { Jumbotron, Container} from 'react-bootstrap';

const Home = () => {
    return (
        <div>
            <Jumbotron fluid className="text-center">
                <Container>
                    <h1>Welcome to Patient Journal System</h1>
                    <p>
                        A secure and efficient way to manage patient information and medical records.
                    </p>
                </Container>
            </Jumbotron>

            <Container className="mt-4">
                <h2>Made By</h2>
                <p>
                    Noor Haddad & Yaman Alkurdi
                </p>
            </Container>
        </div>
    );
};

export default Home
